import './App.css';
import { useState} from "react";

function App() {
  const [ input, setInput ] = useState("");
  return (
    <div className="App">
      <input 
        type="text" 
        value={input}
        onChange={e=> setInput(e.target.value)}
      />
      <div className="terminal">
        {input}
      </div>
    </div>
  );
}

export default App;
